Our crew is now less than 48 hours from lift off, soon coming to the end of our quarantine period. I’ve truly enjoyed reading about and watching all of the humorous things people are creating to help lighten the mood during this stressful time. One example is this video written and filmed by a good friend and the Magnuson family. It’s silly, but the message is spot on…the responsibility to shelter in place lies with every one of us. We all must do our part! ⁣
